import { AllMovies, MovieApi } from "../types/moviesType";
import axios from "axios";
export const getAllMoives = async () => {
  const res = await axios.get(MovieApiMovieApi);
  return { type: AllMovies, data: [1, 2, 3], pages: 0 };
};
